import MainLayout from '../Layouts/MainLayout'
import MainLayoutComponent from '@/pages/MainContent'

const Routers = [
  {
    path: "/main",
    element: <MainLayout />,
    children: [
      // 配置默认的页面
      { path: "/main/content", element: <MainLayoutComponent /> },
    ],
  },
]

export default Routers;
